import 'dart:convert';class AddEventResponse {  AddEventResponse({      this.success,       this.message,       this.event,});  AddEventResponse.fromJson(dynamic json) {    success = json['success'];    message = json['message'];    event = json['event'] != null ? Event.fromJson(json['event']) : null;  }  bool? success;  String? message;  Event? event;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['success'] = success;    map['message'] = message;    if (event != null) {      map['event'] = event?.toJson();    }    return map;  }}class Event {  Event({    this.batches,    this.courses,    this.isPublic,    this.isRegistrable,    this.passedOut,    this.registeredBy,    this.id,    this.eventType,    this.startDate,    this.endDate,    this.eventTitle,    this.detail,    this.institution,    this.createdAt,    this.updatedAt,});  Event.fromJson(dynamic json) {    if (json['batches'] != null) {      batches = [];      List<dynamic>.from(batches!.map((x) => x));    }    if (json['courses'] != null) {      courses = [];      List<dynamic>.from(courses!.map((x) => x));    }    isPublic = json['isPublic'];    isRegistrable = json['isRegistrable'];    passedOut = json['passedOut'];    if (json['registeredBy'] != null) {      registeredBy = [];      List<dynamic>.from(registeredBy!.map((x) => x));    }    id = json['_id'];    eventType = json['eventType'];    startDate = json['startDate'];    endDate = json['endDate'];    eventTitle = json['eventTitle'];    detail = json['detail'];    institution = json['institution'];    createdAt = json['createdAt'];    updatedAt = json['updatedAt'];  }  List<dynamic>? batches;  List<dynamic>? courses;  bool? isPublic;  bool? isRegistrable;  bool? passedOut;  List<dynamic>? registeredBy;  String? id;  String? eventType;  String? startDate;  String? endDate;  String? eventTitle;  String? detail;  String? institution;  String? createdAt;  String? updatedAt;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    if (batches != null) {      map['batches'] = batches?.map((v) => v.toJson()).toList();    }    if (courses != null) {      map['courses'] = courses?.map((v) => v.toJson()).toList();    }    map['isPublic'] = isPublic;    map['isRegistrable'] = isRegistrable;    map['passedOut'] = passedOut;    if (registeredBy != null) {      map['registeredBy'] = registeredBy?.map((v) => v.toJson()).toList();    }    map['_id'] = id;    map['eventType'] = eventType;    map['startDate'] = startDate;    map['endDate'] = endDate;    map['eventTitle'] = eventTitle;    map['detail'] = detail;    map['institution'] = institution;    map['createdAt'] = createdAt;    map['updatedAt'] = updatedAt;    return map;  }}